INSERT INTO `wp_postmeta` VALUES (60,10,'slider_clientes_home','a:6:{i:0;a:4:{s:28:\"foto_casamento_introducao_id\";i:34;s:25:\"foto_casamento_introducao\";s:60:\"http://primos.test/wp-content/uploads/2021/03/cliente-04.jpg\";s:25:\"nome_casamento_introducao\";s:24:\"Casamento Roberta e Hugo\";s:30:\"descricao_casamento_introducao\";s:215:\"Eu fui a um casamento na Primos ainda quando criança, e me encantei tanto com o local que dizia que queria me casar lá, e assim foi! No nosso grande dia ocorreu tudo conforme combinado, a organização foi ótima.\";}i:1;a:4:{s:28:\"foto_casamento_introducao_id\";i:33;s:25:\"foto_casamento_introducao\";s:60:\"http://primos.test/wp-content/uploads/2021/03/cliente-05.jpg\";s:25:\"nome_casamento_introducao\";s:24:\"Casamento Maria e Carlos\";s:30:\"descricao_casamento_introducao\";s:217:\"Eu fui a um casamento no Terraço ainda quando criança, e me encantei tanto com o local que dizia que queria me casar lá, e assim foi! No nosso grande dia ocorreu tudo conforme combinado, a organização foi ótima.\";}i:2;a:4:{s:28:\"foto_casamento_introducao_id\";i:35;s:25:\"foto_casamento_introducao\";s:60:\"http://primos.test/wp-content/uploads/2021/03/cliente-06.jpg\";s:25:\"nome_casamento_introducao\";s:25:\"Casamento Monica e Victor\";s:30:\"descricao_casamento_introducao\";s:190:\"Retornando de viagem, primeiramente, gostaria de agradecer pelos excelentes serviços prestados no nosso casamento. Só recebemos elogios dos convidados e para nós também foi tudo ótimo!!\";}i:3;a:4:{s:28:\"foto_casamento_introducao_id\";i:36;s:25:\"foto_casamento_introducao\";s:60:\"http://primos.test/wp-content/uploads/2021/03/cliente-01.jpg\";s:25:\"nome_casamento_introducao\";s:24:\"Casamento Sara e Roberto\";s:30:\"descricao_casamento_introducao\";s:204:\"A festa da Sara foi um sucesso! Tudo perfeito, comida deliciosa, serviço excelente, equipe super atenciosa, só elogios! Tenho a certeza que escolhemos o melhor local da cidade para realizar nosso sonho!\";}i:4;a:4:{s:28:\"foto_casamento_introducao_id\";i:37;s:25:\"foto_casamento_introducao\";s:60:\"http://primos.test/wp-content/uploads/2021/03/cliente-02.jpg\";s:25:\"nome_casamento_introducao\";s:26:\"Casamento Jessica e Rafeal\";s:30:\"descricao_casamento_introducao\";s:220:\"Extremamente atenciosos conosco durante todo o evento. Buffet maravilhoso, tudo uma delícia. Todos os funcionários extremamente competentes, organizados e profissionais. Amamos o local, vista maravilhosa, tudo de bom. \";}i:5;a:4:{s:28:\"foto_casamento_introducao_id\";i:38;s:25:\"foto_casamento_introducao\";s:60:\"http://primos.test/wp-content/uploads/2021/03/cliente-03.jpg\";s:25:\"nome_casamento_introducao\";s:27:\"Casamento Letícia e Victor\";s:30:\"descricao_casamento_introducao\";s:112:\"Estava tudo ótimo como sempre... Serviço de vocês é impecável!!\r\nObrigada mais uma vez e até a próxima!!!\";}}');
