INSERT INTO `wp_postmeta` VALUES (143,12,'paragrafos_servicos','a:3:{i:0;a:1:{s:18:\"paragrafo_servicos\";s:335:\"Os serviços complementares são imprescindíveis à realização de um evento. Para cada item, existem milhares de profissionais no mercado. Mas como saber qual é o melhor custo-benefício? Quais deles tem o perfil que você espera? Com anos de experiência, nossa assessoria firmou parcerias com profissionais altamente capacitados.\";}i:1;a:1:{s:18:\"paragrafo_servicos\";s:208:\"Uma semana antes da festa fazemos uma reunião com todos os profissionais envolvidos, garantindo o entendimento de tudo aquilo que foi contratado e estabelecemos horários de montagem, entregas e desmontagem.\";}i:2;a:1:{s:18:\"paragrafo_servicos\";s:389:\"No dia da festa, somos os primeiros a chegar. Recebemos cada um dos fornecedores, checando os itens contratados e coordenando a montagem de acordo com o layout pré-estabelecido. Resolvemos quaisquer imprevistos e emergências, sem que você seja incomodado. Cuidamos de todos os mínimos detalhes, do planejamento a coordenação no dia festa. Para que tudo seja especial e inesquecível!\";}}');
