INSERT INTO `wp_postmeta` VALUES (184,14,'titulo_espaco','O Espaço');
INSERT INTO `wp_postmeta` VALUES (185,14,'paragrafo_espaco','A primos tem como diferencial uma estrutura completa para todos os tipos de evento, sendo casamentos, aniversários, confraternizações e eventos corporativos. Em uma das mais belas paisagens da região, nosso local possui espaço para cerimônia, dois ambientes para convidados, estacionamento, espaço para shows, e muito mais para você a realizar seu evento cercado de belezas naturais com toda tranquilidade, privacidade em uma estrutura única, rústica e sofisticada.');
