INSERT INTO `wp_postmeta` VALUES (205,16,'titulo_sobre','Sobre');
INSERT INTO `wp_postmeta` VALUES (206,16,'paragrafo_sobre','a:4:{i:0;a:1:{s:15:\"paragrafo_sobre\";s:269:\"Chácara Primos oferece um espaço único para um evento perfeito. Os melhores momentos da vida merecem um local preparado para transformá-los em eventos inesquecíveis. A Primos foi projetada para ser o primeiro e mais completo centro de eventos de Sumaré e região.\";}i:1;a:1:{s:15:\"paragrafo_sobre\";s:232:\"Com capacidade para realização de todo tipo de eventos sociais como, casamentos, festas de aniversário, formaturas e shows, a eventos corporativos como feiras, cursos, exposições, convenções, jornadas, workshops entre outros.\";}i:2;a:1:{s:15:\"paragrafo_sobre\";s:236:\"As mais modernas instalações em sua infraestrutura, beleza e harmonia nos detalhes, conforto e segurança nos espaços, A primos já encanta logo com sua bela fachada e torna o evento memorável logo na recepção dos seus convidados.\";}i:3;a:1:{s:15:\"paragrafo_sobre\";s:256:\"Em seu salão projetado de forma versátil podendo ser convertido em vários ambientes, permitindo a realização de eventos simultâneos. Para qualquer ocasião a Primos é a escolha perfeita para a realização do mais simples ao mais sofisticado evento.\";}}');
INSERT INTO `wp_postmeta` VALUES (207,16,'paragrafos_sobre','a:4:{i:0;a:1:{s:15:\"paragrafo_sobre\";s:273:\"Chácara Primos oferece um espaço único para um evento perfeito. Os melhores momentos da vida merecem um local preparado para transformá-los em eventos inesquecíveis. A Primos foi projetada para ser o primeiro e mais completo centro de eventos de Aparecida de Goiânia.\";}i:1;a:1:{s:15:\"paragrafo_sobre\";s:232:\"Com capacidade para realização de todo tipo de eventos sociais como, casamentos, festas de aniversário, formaturas e shows, a eventos corporativos como feiras, cursos, exposições, convenções, jornadas, workshops entre outros.\";}i:2;a:1:{s:15:\"paragrafo_sobre\";s:236:\"As mais modernas instalações em sua infraestrutura, beleza e harmonia nos detalhes, conforto e segurança nos espaços, A primos já encanta logo com sua bela fachada e torna o evento memorável logo na recepção dos seus convidados.\";}i:3;a:1:{s:15:\"paragrafo_sobre\";s:256:\"Em seu salão projetado de forma versátil podendo ser convertido em vários ambientes, permitindo a realização de eventos simultâneos. Para qualquer ocasião a Primos é a escolha perfeita para a realização do mais simples ao mais sofisticado evento.\";}}');
