INSERT INTO `wp_postmeta` VALUES (214,22,'titulo_casamento','Casamentos');
INSERT INTO `wp_postmeta` VALUES (215,22,'frase_efeito_casamento','Momentos incríveis não podem ser esquecidos');
INSERT INTO `wp_postmeta` VALUES (216,22,'paragrafo_casamento','Alguns momentos ficam guardados para sempre na memória e no coração. A recepção do casamento é a confirmação do passo mais importante da vida de um casal, uma ocasião cercada de amor e alegria e do desejo da perfeição nos mínimos detalhes, como nossa sala de noivas, impecável no conforto e preparada para todo apoio necessário. O grande momento da sua vida, deve ser realizado na Primos.');
